// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/cryptography/ECDSA.sol";

contract BounceERC721WithSign is ERC721, Ownable {
    address public signer;

    constructor (string memory name_, string memory symbol_) public ERC721(name_, symbol_) {}

    function setSigner(address _signer) external onlyOwner {
        signer = _signer;
    }

    function setBaseURI(string calldata baseURI_) external onlyOwner {
        super._setBaseURI(baseURI_);
    }

    function mint(address to, uint256 tokenId) external onlyOwner {
        super._safeMint(to, tokenId);
    }

    function burn(uint256 tokenId) external onlyOwner {
        super._burn(tokenId);
    }

    function mintUser(uint256 id, bytes calldata sign) external {
        bytes32 hash = ECDSA.toEthSignedMessageHash(keccak256(abi.encodePacked(msg.sender, id)));
        require(ECDSA.recover(hash, sign) == signer, "INVALID SIGNER");
        super._mint(msg.sender, id);
    }
}
